  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { GoogleMap, LoadScript } from "react-google-maps-api/lib";
import WithApiKey from "./WithApiKey";

const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"googlemap"}}>{`GoogleMap`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-jsx"}}>{`<LoadScript
  id="script-loader"
  googleMapsApiKey={API_KEY}
  language={"en"}
  region={"EN"}
  version={"weekly"}
  libraries={[]}
  onLoad={() => console.log("script loaded")}
  loadingElement={<div>Loading...</div>}
>
  <GoogleMap
    id="basic-map-example"
    mapContainerStyle={{
      height: "400px",
      width: "800px"
    }}
    zoom={8}
    center={{
      lat: -34.397,
      lng: 150.644
    }}
  />
</LoadScript>
`}</MDXTag></MDXTag>
<WithApiKey>
  {apiKey => (
    <LoadScript
      id="script-loader"
      googleMapsApiKey={apiKey}
      language={"en"}
      region={"EN"}
      version={"weekly"}
      libraries={[]}
      onLoad={() => console.log("script loaded")}
      loadingElement={<div>Loading...</div>}
    >
      <GoogleMap
        id="basic-map-example"
        mapContainerStyle={{
          height: "400px",
          width: "800px"
        }}
        zoom={8}
        center={{
          lat: -34.397,
          lng: 150.644
        }}
      />
    </LoadScript>
  )}
</WithApiKey>
           </MDXTag>
  }
}
